    "# 2. Ask Phase\n",
    "## 2.1 Business Task\n",
    "Identify trends and patters in how users use non-bellabeat smart devices to apply insights into Bellabeat's Marketing Strategy.\n",
    "\n",
    "### Key Stakeholders\n",
    "* Urška Sršen - Bellabeat cofounder and Chief Creative Officer\n",
    "* Sando Mur - Bellabeat cofounder and key member of Bellabeat executive team\n",
    "* Bellabeat Marketing Analytics team\n"
   ]
  },
