   "source": [
    "daily_use <- daily_activity_sleep %>%\n",
    " group_by(id) %>%\n",
    " summarize(days_used = sum(n())) %>%\n",
    " mutate(usage = case_when(\n",
    "     days_used >= 1 & days_used <= 10 ~ \"low use\",\n",
    "    days_used >= 11 & days_used <= 20 ~ \"moderate use\", \n",
    "    days_used >= 21 & days_used <= 31 ~ \"high use\"))\n",
    "\n",
    "head(daily_use)"
   ]
